import React from "react";
import Emojipedia from '../emojipedia';
import Card from './Card';

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
        <Card {...Emojipedia[0]} />
        <Card {...Emojipedia[1]} />
        <Card {...Emojipedia[2]} />
      </dl>
    </div>
  );
}

export default App;
